import React from 'react';
import PropTypes from 'prop-types';
import './popup.scss';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleXmark } from '@fortawesome/free-solid-svg-icons';

import { Button } from '@mui/material';
import  OutlinedButton  from '../button/OutlinedButton';

const PopupHeader = () => {
    return(
        <div>
            <div className="popup_text_style">
                <h3>Popup Title</h3>
            </div>
                <label for="trigger" className="close_btn popup_icon_style">
                    <FontAwesomeIcon icon={faCircleXmark} className="fa-sm fa-fw"/>
                </label>
        </div>
    )
}

const PopupBody = () => {
    return(
        <div>
            <div className="popup-body">
                <div>

                </div>
            </div>
        </div>
    )
}

const Popup = () => {
    return(
        <div>
            <label for="trigger" className="open_btn">Button for Popup</label>
            <div className="popup_wrap">
                <input id="trigger" type="checkbox"/>
                <div className="popup_overlay">
                    <label for="trigger" className="popup_trigger"></label>
                        <div className="popup_content">
                            <PopupHeader />
                            <p>Popup question??</p>
                            <div className="centering">
                                <div className="button_center">
                                    <OutlinedButton >キャンセル</OutlinedButton>
                                    <OutlinedButton >OK</OutlinedButton>
                                </div>

                            </div>
                        </div>
                </div>
            </div>
        </div>
    )
}

export default Popup;
